import React  from 'react';
import OwnItems from './Ownitem';

const Ownposts = ({ownPosts}) => {


    return (
        <div>
            sdsd
            {
                ownPosts.map(ownPost=>(
                   <OwnItems key={ownPost.id} ownPost={ownPost}/>
                ))
            }
        </div>
    )
}

export default Ownposts
